import './Footer.css';

const Footer = () => {
  return (
    <div className='footer-container'>
      <div className='footer-contact-info'>
        <p>Contact info:</p>
        <p>Tahar Garage Door Services</p>
        <p>2814 Deerborn Ave.</p>
        <p>Palmdale, California</p>
      </div>
    </div>
  );
};

export default Footer;
